import { Instant } from "../Instant/Instant.js";

function templateToPrint(sells) {

    const {format}=Instant()

    function numberFormat(n){
   
        if(n!==''){
    
            let resolve = new Intl.NumberFormat('es-Mx').format(n)
            return resolve;
    
        }else{
    
            return ''; 
    
        }
            
        }   
    
     function renderTd(uni, product, sellCost){
            
            const Product= product.split(' ')
            const Uni = uni.split(' ')
            const SellCost= sellCost.split(' ') 
        
            let render =``; 
        
            for (let index in Product){
        
                render +=`
                <tr>
                    <td id='print-td'>${numberFormat(Uni[index])}</td>
                    <td id='print-td'>${Product[index]}</td>
                    <td id='print-td'>${numberFormat(SellCost[index])}</td>
        
                </tr>   
                `
           
            }
         
        
            return render; 
            /**<td>${sells.uni}</td>
            <td>${sells.product}</td>
            <td>${sells.sellCost}</td> */
            
        
        }  
   
        

    return `
   
     <body id='print-container'>

      <header id='print-header'>
        
       <div id='print-titile-image-body'>
      
  
         <div id='image-print-container'>
           <img id='image-print' xmlns="http://www.w3.org/1999/xhtml" alt="" src="data:image/png;base64," />
         </div> 

         <p id='print-header-text'>Erica Fashion</p>
       </div>
      
  
       <div id='print-line'></div>   
        <div>
          
          <p id='print-header-title2'><span id='print-header-title'>Instagram:</span> @erica_fashion25</p>
          <p id='print-header-title2'><span id='print-header-title'>Telefono:</span>(829)-880-6000</p>
          <p id='print-header-title2'><span id='print-header-title'>Fecha:</span> ${format(sells.date, 'fecha', 'es', 'medium', 'short')}</p>
          <p id='print-header-title2'><span id='print-header-title'>Cliente:</span> ${sells.customer}</p>
          <p id='print-header-title2'><span  id='print-header-title'>No. Recibo:</span> ${sells.id}</p>
        </div>
          
      </header>
      <div id='print-register-body'>
          <table id='print-table'>
              <tr>
                  <th id='print-th'>Unidades</th>
                  <th id='print-th'>Producto</th>
                  <th id='print-th'>Costo</th>
              </tr>  
  
              ${renderTd(sells.uni, sells.product, sells.sellCost)}
         
          </table> 
          <footer id='print-footer'>
            <p  id='print-total-text'>Total: <span>${numberFormat(sells.sellCostTotal)}</span></p>
          </footer>
      </div>
       
       <p id='print-footer-text'>Los clientes como <b>${sells.customer}</b> son los que nos inspiran para ser cada da un poco mejores, as que solamente podemos hacer dos cosas: seguir mejorando y darle las gracias. </p>
       <div id='print-line2'></div>
       </body>
  `
    
}
  
  
 export function printDiv(data) {

      const InfoContainer = document.querySelectorAll('#print');
      const InfoContainer2 = document.querySelectorAll('#print-btn');
      const header = document.querySelectorAll('#data-register-btn-header');
      const arrow = document.querySelectorAll('#arrow');

      //console.log(document.location.hash)
    //  console.log(InfoContainer)

  
      for (let i = 0; i < data.length; i++) {
  
          InfoContainer[i]?.addEventListener('click', () => {
  
          
  
              header[i].style.display = 'none';
  
              //let contenido= document.getElementById(nombreDiv).innerHTML;
              let contenido = templateToPrint(data[i]);
              const mainHeader = document.getElementById('header');
              const menu = document.getElementsByClassName('menu')[0];
              const routes = document.getElementById('routes');
              let setDataToprint =  document.getElementById('setDataToprint');

              mainHeader.style.display='none';
              menu.style.display='none';
              routes.style.display='none';
              setDataToprint.style.display = 'block';
  
              setDataToprint.innerHTML = contenido;
  
              setTimeout(()=>{
               
                 window.print();
                 arrow[i].style.display = 'inline'
              },500)

              window.onafterprint = (event) => {

                const mainHeader = document.getElementById('header');
                const menu = document.getElementsByClassName('menu')[0];
                const routes = document.getElementById('routes');
                let setDataToprint =  document.getElementById('setDataToprint');
                
            
                setDataToprint.style.display='none';
                mainHeader.style.display='flex';
                menu.style.display='flex';
                routes.style.display='flex';
               
             };
              
       })

       InfoContainer2[i]?.addEventListener('click', () => {
  
          
  
        header[i].style.display = 'none';

        //let contenido= document.getElementById(nombreDiv).innerHTML;
        let contenido = templateToPrint(data[i]);
        const mainHeader = document.getElementById('header');
        const menu = document.getElementsByClassName('menu')[0];
        const routes = document.getElementById('routes');
        let setDataToprint =  document.getElementById('setDataToprint');

        mainHeader.style.display='none';
        menu.style.display='none';
        routes.style.display='none';
        setDataToprint.style.display = 'block';

        setDataToprint.innerHTML = contenido;

        setTimeout(()=>{
         
           window.print();
           arrow[i].style.display = 'inline'
        },500) 


        window.onafterprint = (event) => {

          const mainHeader = document.getElementById('header');
          const menu = document.getElementsByClassName('menu')[0];
          const routes = document.getElementById('routes');
          let setDataToprint =  document.getElementById('setDataToprint');
          
      
          setDataToprint.style.display='none';
          mainHeader.style.display='flex';
          menu.style.display='flex';
          routes.style.display='flex';
         
       };
        
    })

   
  
   }
  


  
  }
  